import React from 'react';

const TableHeader = ({data}) => {
    const tableColumns = data.columns;
    const tableRows = data.rows;

    return(
        <thead>
      <tr>
        {tableColumns.map((column) =>
          <th >{column}</th> )}
      </tr>
    </thead>
    )

   
